        textAlign: 'center',
        font: ' Bold 35px/45px PT Sans',
        letterSpacing: '0',
        color: '#212529',
        opacity: '1',
    },
    para: {
        textAlign: 'center',
        font: ' Regular 18px/27px PT Sans',
        letterSpacing: 0,
        color: '#868E96',
        opacity: '1',
        marginTop: '22px',
    },
    data: {
        justifyContent: 'center',
        display: 'flex',
        flexWrap: 'wrap',
        '& > :nth-child(n+1)': {
            margin: '16px',
            hover:'pointer',
        },
    },
});
